import React from "react";
import MUIDataTable from "mui-datatables";
import axios from "axios";


export default class Profile extends React.Component {
    constructor(props) {
        super(props);

        const getData = async (e) => {
            return await axios.get(`http://localhost:5000/getAdmins`).data;
        };

        this.state = {
            data: [getData()],
        };
    }

    

    render() {
        const columns = [
        
            {
                name: "Edit",
                options: {
                    filter: true,
                    sort: false,
                    empty: true,
                    customBodyRender: (value, tableMeta, updateValue) => {
                        return (
                            <button onClick={() => window.alert(`Clicked "Edit" for row ${tableMeta.rowIndex}`)}>
                                Edit
                            </button>
                        );
                    }
                }
            },
            {
                label: "Korisničko ime",
                name: "username",
                options: {
                    filter: true,
                }
            },
            {
                label: "Ime",
                name: "name",
                options: {
                    filter: true,
                }
            },
            {
                label: "rezime",
                name: "surname",
                options: {
                    filter: false,
                }
            },
            {
                name: "Remove Admin",
                options: {
                    filter: true,
                    sort: false,
                    empty: true,
                    customBodyRender: (value, tableMeta, updateValue) => {
                        return (
                            <button onClick={() => {
                                const { data } = this.state;
                                data.shift();
                                this.setState({ data });
                            }}>
                                Delete
                            </button>
                        );
                    }
                }
            },
        ];


        const options = {
            filter: true,
            filterType: 'dropdown',
            responsive: 'stacked',
            page: 2,
            onColumnSortChange: (changedColumn, direction) => console.log('changedColumn: ', changedColumn, 'direction: ', direction),
            onChangeRowsPerPage: numberOfRows => console.log('numberOfRows: ', numberOfRows),
            onChangePage: currentPage => console.log('currentPage: ', currentPage)
        };

        return (
            <MUIDataTable title={"Admini"} data={data &&
                data.map(function(item, i) {
                  console.log(item);
                  return (
                    <tr key={i}>
                      <td>{item.username}</td>
                      <td>{item.name}</td>
                      <td>{item.surname}</td>
              
                    </tr>
                  );
                })} columns={columns} options={options} />
        );

    }

}
